import { Typography } from '@mui/material'
import React from 'react'

const Add_item = () => {
  return (
    <div>
      <Grid container spacing={2} style={{
        border:'2px solid red'
      }}>

      </Grid>
      <Typography variant='h4'>Add Item Product</Typography>
    </div>
  )
}

export default Add_item
